import React, { Component, Fragment } from 'react';
import TextField from '@material-ui/core/TextField';


class Search extends Component {

    state = { };

    render() {

        return (
            <Fragment>

                <TextField
                    mt={3}
                    id="outlined-number"
                    label="Number"
                    type="number"
                    InputLabelProps={{
                        shrink: true,
                    }}
                    variant="outlined"
                />
            </Fragment>
        );
    }

}

export default Search;
